import React from "react";
import style from './stajl.css'
const Apps = () => {
    return (
        <div className="app-container">

            <div className="temperature-display-container">
                <div className="temperature-display ">
                    10C

                </div>

            </div>



        </div>
    )
}


export default Apps;
